import React, { Component } from 'react'

class InfoBar extends Component {
    renderInfo(){
        if (this.props.node){
            return(
                <table>
                    <tr><td> ID is {this.props.node.Details._id}</td></tr>
                    <tr><td> ChainID is {this.props.node.Details._chain_id}</td></tr>
                </table>
            )
        }
        return (
           <tr/>
        )
    }

    render() {
        return (
            <div className="InfoBar">
                <h3 className="title">Details : </h3>
                    {this.renderInfo()}
            </div> 
        )
    }
}

export default InfoBar
